export function ConnectedContractProps1(props) {
	return (
		<p>
			<b> Target Contract </b><br/>
			<span> {props.contractAddress || "Not a valid contract address"} </span><br/>

			<span> 
				<b>Name: </b> {props.contractName || "Not available"} <br/>
				<b>Symbol: </b> {props.contractSymbol || "Not available"} 
			</span>
		</p>
	)
}

export function ConnectedContractProps(props) {
	return (
		<div className="columns container">
			<div className="column border-left">
				<b> Target Contract </b>
				<span> {props.contractAddress || "Not a valid contract address"}</span>

			</div>
			<div className="column border-left">
				<b>Name: </b> {props.contractName || "Not available"}
			</div>
			<div className="column border-left">
				<b>Symbol: </b> {props.contractSymbol || "Not available"}
			</div>
		</div>
	)
}
